import React from 'react';

const Footer = () => {
    return(
        <footer style={{height:'160px',width:"100%", backgroundColor:'#726E64', zIndex:1}}>
           <strong><p className='text-center' style={{paddingTop:'60px',color:"white", fontSize:"17px"}}>Developed by Daniel Karanja</p>
            <p className='text-center text-white'>2023</p></strong>

        </footer>
    )
}

export default Footer;
